import { Link } from "react-router-dom"


function NavBar(){

    return(
        <div>
            <Link to="/"> Home </Link> 
            <Link to="/addshow"> Add Show </Link>
            <Link to="/shows"> Show Card </Link>
        </div>
    );
}

export default NavBar;
